INSERT INTO `tabPrint Style` VALUES ('Classic','2017-08-17 02:00:12.502887','2017-08-18 00:43:48.675833','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,1,'/*\n	common style for whole page\n	This should include:\n	+ page size related settings\n	+ font family settings\n	+ line spacing settings\n*/\n.print-format div,\n.print-format span,\n.print-format td,\n.print-format h1,\n.print-format h2,\n.print-format h3,\n.print-format h4 {\n	font-family: Georgia, serif;\n}\n\n/* classic format: for-test */',NULL,NULL,'Classic',0,'/assets/frappe/images/help/print-style-classic.png',NULL),('Modern','2017-08-17 02:16:58.060374','2017-08-18 00:44:07.438147','Administrator','Administrator',0,NULL,NULL,NULL,0,NULL,1,'.print-heading {\n	text-align: right;\n	text-transform: uppercase;\n	color: #666;\n	padding-bottom: 20px;\n	margin-bottom: 20px;\n	border-bottom: 1px solid #d1d8dd;\n}\n\n.print-heading h2 {\n	font-size: 24px;\n}\n\n.print-format th {\n	background-color: #eee !important;\n	border-bottom: 0px !important;\n}\n\n/* modern format: for-test */',NULL,NULL,'Modern',0,'/assets/frappe/images/help/print-style-modern.png',NULL),('Monochrome','2017-08-17 02:16:20.992989','2017-08-18 00:44:25.023898','Administrator','Administrator',0,NULL,NULL,NULL,0,NULL,1,'.print-format * {\n	color: #000 !important;\n}\n\n.print-format .alert {\n	background-color: inherit;\n	border: 1px dashed #333;\n}\n\n.print-format .table-bordered,\n.print-format .table-bordered > thead > tr > th,\n.print-format .table-bordered > tbody > tr > th,\n.print-format .table-bordered > tfoot > tr > th,\n.print-format .table-bordered > thead > tr > td,\n.print-format .table-bordered > tbody > tr > td,\n.print-format .table-bordered > tfoot > tr > td {\n	border: 1px solid #333;\n}\n\n.print-format hr {\n	border-top: 1px solid #333;\n}\n\n.print-heading {\n	border-bottom: 2px solid #333;\n}\n',NULL,NULL,'Monochrome',0,'/assets/frappe/images/help/print-style-monochrome.png',NULL);
